import React, { useEffect, useState } from 'react';
import axios from 'axios';

function TransactionHistory() {
  const [purchases, setPurchases] = useState([]);
  const [purchasesPage, setPurchasesPage] = useState(1);

  const [transfers, setTransfers] = useState([]);
  const [transfersPage, setTransfersPage] = useState(1);

  const [assignments, setAssignments] = useState([]);
  const [assignmentsPage, setAssignmentsPage] = useState(1);

  const [expenditures, setExpenditures] = useState([]);
  const [expendituresPage, setExpendituresPage] = useState(1);

  const limit = 5;
  const token = localStorage.getItem('token');

  useEffect(() => {
    fetchTransactions();
  }, [purchasesPage, transfersPage, assignmentsPage, expendituresPage]);

  const fetchTransactions = async () => {
    try {
      const purchaseRes = await axios.get(`http://localhost:5000/api/assets/purchases?page=${purchasesPage}&limit=${limit}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setPurchases(purchaseRes.data);

      const transferRes = await axios.get(`http://localhost:5000/api/assets/transfers?page=${transfersPage}&limit=${limit}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setTransfers(transferRes.data);

      const assignmentRes = await axios.get(`http://localhost:5000/api/assets/assignments?page=${assignmentsPage}&limit=${limit}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setAssignments(assignmentRes.data);

      const expenditureRes = await axios.get(`http://localhost:5000/api/assets/expenditures?page=${expendituresPage}&limit=${limit}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setExpenditures(expenditureRes.data);

    } catch (err) {
      console.error(err);
    }
  };

  // Pagination handlers
  const handlePrev = (setter, page) => {
    if (page > 1) setter(page - 1);
  };

  const handleNext = (setter, page) => {
    setter(page + 1);
  };

  return (
    <div style={{ padding: '20px' }}>
      <h2>Transaction History</h2>

      {/* Purchases */}
      <h3>Purchases</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Purchase ID</th>
            <th>Asset Name</th>
            <th>Quantity</th>
            <th>Purchased On</th>
          </tr>
        </thead>
        <tbody>
          {purchases.map((p, index) => (
            <tr key={index}>
              <td>{p.asset_id}</td>
              <td>{p.asset_name}</td>
              <td>{p.quantity}</td>
              <td>{p.purchased_on}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <button onClick={() => handlePrev(setPurchasesPage, purchasesPage)}>Previous</button>
      <button onClick={() => handleNext(setPurchasesPage, purchasesPage)}>Next</button>

      {/* Transfers */}
      <h3>Transfers</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Transfer ID</th>
            <th>Asset ID</th>
            <th>From Base</th>
            <th>To Base</th>
            <th>Quantity</th>
            <th>Transfer Date</th>
          </tr>
        </thead>
        <tbody>
          {transfers.map((t, index) => (
            <tr key={index}>
              <td>{t.transfer_id}</td>
              <td>{t.asset_id}</td>
              <td>{t.from_base_id}</td>
              <td>{t.to_base_id}</td>
              <td>{t.quantity}</td>
              <td>{t.transfer_date}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <button onClick={() => handlePrev(setTransfersPage, transfersPage)}>Previous</button>
      <button onClick={() => handleNext(setTransfersPage, transfersPage)}>Next</button>

      {/* Assignments */}
      <h3>Assignments</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Assignment ID</th>
            <th>Asset ID</th>
            <th>Personnel Name</th>
            <th>Quantity</th>
            <th>Assigned On</th>
          </tr>
        </thead>
        <tbody>
          {assignments.map((a, index) => (
            <tr key={index}>
              <td>{a.assignment_id}</td>
              <td>{a.asset_id}</td>
              <td>{a.personnel_name}</td>
              <td>{a.quantity}</td>
              <td>{a.assigned_date}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <button onClick={() => handlePrev(setAssignmentsPage, assignmentsPage)}>Previous</button>
      <button onClick={() => handleNext(setAssignmentsPage, assignmentsPage)}>Next</button>

      {/* Expenditures */}
      <h3>Expenditures</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Expenditure ID</th>
            <th>Asset ID</th>
            <th>Quantity</th>
            <th>Expended On</th>
          </tr>
        </thead>
        <tbody>
          {expenditures.map((e, index) => (
            <tr key={index}>
              <td>{e.expenditure_id}</td>
              <td>{e.asset_id}</td>
              <td>{e.quantity}</td>
              <td>{e.expended_date}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <button onClick={() => handlePrev(setExpendituresPage, expendituresPage)}>Previous</button>
      <button onClick={() => handleNext(setExpendituresPage, expendituresPage)}>Next</button>
    </div>
  );
}

export default TransactionHistory;
